// App.js
import React from 'react';
import { BrowserRouter as Router, Route, NavLink, Switch } from 'react-router-dom';
import AllTodosIds from './component/AllTodosIds';
import AllTodosIdsAndTitles from './component/AllTodosIdsAndTitles';
import UnresolvedTodos from './component/UnresolvedTodos';
import ResolvedTodos from './component/ResolvedTodos';
import AllTodosIdsAndUserIds from './component/AllTodosIdsAndUserIds';
import ResolvedTodosWithUserIds from './component/ResolvedTodosWithUserIds';
import UnresolvedTodosWithUserIds from './component/UnresolvedTodosWithUserIds';
import './App.css'; // Importar el archivo App.css
const App = () => {
  return (
    <Router>
      <div className="App">
        <nav className="Navbar">
          <ul className="Navbar-list">
            <li className="Navbar-item">
              <NavLink exact to="/" activeClassName="Navbar-link-active" className="Navbar-link">Todos IDs</NavLink>
            </li>
            <li className="Navbar-item">
              <NavLink to="/todos-titles" activeClassName="Navbar-link-active" className="Navbar-link">Todos IDs and Titles</NavLink>
            </li>
            <li className="Navbar-item">
              <NavLink to="/unresolved-todos" activeClassName="Navbar-link-active" className="Navbar-link">Unresolved Todos</NavLink>
            </li>
            <li className="Navbar-item">
              <NavLink to="/resolved-todos" activeClassName="Navbar-link-active" className="Navbar-link">Resolved Todos</NavLink>
            </li>
            <li className="Navbar-item">
              <NavLink to="/todos-userids" activeClassName="Navbar-link-active" className="Navbar-link">Todos IDs and UserIDs</NavLink>
            </li>
            <li className="Navbar-item">
              <NavLink to="/resolved-todos-userids" activeClassName="Navbar-link-active" className="Navbar-link">Resolved Todos with UserIDs</NavLink>
            </li>
            <li className="Navbar-item">
              <NavLink to="/unresolved-todos-userids" activeClassName="Navbar-link-active" className="Navbar-link">Unresolved Todos with UserIDs</NavLink>
            </li>
          </ul>
        </nav>
        <Switch>
          <Route exact path="/" component={AllTodosIds} />
          <Route path="/todos-titles" component={AllTodosIdsAndTitles} />
          <Route path="/unresolved-todos" component={UnresolvedTodos} />
          <Route path="/resolved-todos" component={ResolvedTodos} />
          <Route path="/todos-userids" component={AllTodosIdsAndUserIds} />
          <Route path="/resolved-todos-userids" component={ResolvedTodosWithUserIds} />
          <Route path="/unresolved-todos-userids" component={UnresolvedTodosWithUserIds} />
        </Switch>
      </div>
    </Router>
  );
};

export default App;
